# prompt
function prompt {
  "$(Get-Date -format "dd/MM") - $(Get-Location)> " 
}

# log
function loginfo([string]$message, [string] $title= "info") {
  Write-Host -Foreground blue "$($title.ToUpper()): $message" 
}
function logsuccess([string]$message, [string] $title= "success") {
  Write-Host -Foreground green "$($title.ToUpper()): $message" 
}
function logerror([string]$message, [string] $title= "error") {
  Write-Host -Foreground red "$($title.ToUpper()): $message" 
}
function errorlog {
  $err= Get-Error 
  logerror "Oups ! An error occured üòî" 
  Write-Host "`n$($err.Exception.Message)`n"
  Write-Host "$($err.InvocationInfo.PositionMessage)`n"
  exit 
}

# git
function gadd ([string] $files= "./") {
  git add $files
}
function gcom ([string] $commit= "init"){
  git commit -am $commit
}
function gpush {
  git push
}
function gstat ([string] $files= "./") {
  git status $files
}
function glog {
  git log --oneline
}
function gdiff ([string] $files= "./") {
  git diff $files
}
function gstats {
  $directories= Get-Childitem -Directory
  $i= 0

  foreach ($dir in $directories){
    Set-Location $dir
    if (Test-Path ".git") {
      logsuccess $dir.Name "GIT"
      git status
      $i++
    } else {
      logerror $dir.Name "NOT GIT"
    }
    Set-Location "../"
  }

  loginfo "$i/$($directories.Length) Git repositories"
}
function ginit {
  git init
  gadd
  gcom
}

# search
function grep([string] $search, [string] $path= "./") {
  Get-ChildItem -Recurse $path | Select-String $search
}
function search([string] $file, [string] $path= "./", [bool] $hidden= $false) {
  if ($hidden) {
    Get-Childitem -Recurse -Hidden $path | ? Name -match $file | % Fullname
  } else {
    Get-Childitem -Recurse $path | ? Name -match $file | % Fullname
  }
}

# time
function today {
  Get-Date -Format "dd-MM-yy"
}

# file system 
function path {
  Set-Clipboard $(Get-Location).Path
  loginfo "Path copied"
}
function folder([string] $dir) {
  if (Test-Path $dir) { return }
  New-Item $dir -ItemType Directory 
}
function getcp([string] $path, [bool] $inFolder= $false) {
  $path= $path.Replace("/", "\")
  $file= $(Get-Item $path).BaseName 

  if (Test-Path $path -PathType Leaf) {
    xcopy $path ".\" /s /i 
  } elseif (Test-Path $path -PathType Container) {
    $inFolder ? $(xcopy $path ".\" /s /i) : $(xcopy $path $file /s /i)  
  } else {
    logerror "Error while copying $path" 
  }
}
function util([string[]] $files) {
  foreach ($util in $files) {
    if (getcp "$PRG\utils\$util") {
      loginfo "Util $util copied" 
    }
    else {
      logerror "Error while copying $util" 
    }
  }
}

# network
function lch([int] $port= 8080) {
  Start-Process "http://localhost:$port"  
}

# data
function lorem([int] $count=1) {
  $lorem= "Lorem ipsum dolor sit, amet consectetur adipisicing elit. Quis eos ipsum aut laudantium nihil aliquid, vel a odio eaque quisquam dignissimos quo. Beatae similique aspernatur ipsam, rerum expedita ducimus, dignissimos sapiente praesentium id velit sint, aliquid ab reprehenderit numquam? Dignissimos maxime provident molestiae veritatis rem eius ea labore expedita dolorem." 
  $res= "" 

  for ($i= 0; $i -lt $count; $i++) {
    $res+= "$lorem`n" 
  }

  Write-Output $res 
  Set-Clipboard $res   
}

// Neopixel Color Picker
// 11/2/2025

// Turn pot to change color or brightness
// Press button to toggle between color and brightness
// Read HSV or RGB value in Serial Monitor

#include <FastLED.h>
#define LED_PIN 2
#define NUM_LEDS 1
#define BUTTON_PIN 4
#define POT_PIN A0
CRGB leds[NUM_LEDS];
bool modeColor = true;  // true = color mode, false = brightness mode
int buttonState;        // current stable state
int lastButtonState = HIGH;
unsigned long lastDebounceTime = 0;
const unsigned long debounceDelay = 50;
uint8_t hue = 0;
float brightness = 0.5;

// For change detection (reduce serial spam)
static uint8_t lastHue = 255;
static float lastBrightness = -1.0;

// Smooth potentiometer reading
int readPotSmooth() {
  int sum = 0;
  for (int i = 0; i < 5; i++) {
    sum += analogRead(POT_PIN);
    delay(2);
  }
  return sum / 5;
}

void setup() {
  Serial.begin(9600);
  FastLED.addLeds<NEOPIXEL, LED_PIN>(leds, NUM_LEDS);
  pinMode(BUTTON_PIN, INPUT_PULLUP);
  analogReference(DEFAULT);
  FastLED.setBrightness(brightness * 255);
  leds[0] = CHSV(hue, 255, 255);
  FastLED.show();
  Serial.println(F("Arduino Color Picker Example"));
  Serial.println(F("Press button to toggle between color and brightness control"));
}

void loop() {
  int reading = digitalRead(BUTTON_PIN);
  // --- Debounce the button ---
  if (reading != lastButtonState) {
    lastDebounceTime = millis();
  }
  if ((millis() - lastDebounceTime) > debounceDelay) {
    if (reading != buttonState) {
      buttonState = reading;
      // Toggle on press (HIGH ‚Üí LOW)
      if (buttonState == LOW) {
        modeColor = !modeColor;
        Serial.println();
        Serial.println(F("--------------------------"));
        Serial.print(F("Mode changed to: "));
        Serial.println(modeColor ? F("COLOR") : F("BRIGHTNESS"));
        Serial.println(F("--------------------------"));
        // --- Visual indicator flash ---
        if (modeColor) {
          // Flash current hue at *full* brightness for visibility
          FastLED.setBrightness(255);
          leds[0] = CHSV(hue, 255, 255);
        } else {
          // Flash white at current brightness
          FastLED.setBrightness(brightness * 255);
          leds[0] = CRGB::White;
        }
        FastLED.show();
        delay(500);  // flash duration
        // Restore last display
        FastLED.setBrightness(brightness * 255);
        leds[0] = CHSV(hue, 255, 255);
        FastLED.show();
        delay(500);  // pause so user can notice the change
      }
    }
  }
  lastButtonState = reading;

  // --- Potentiometer reading (smoothed) ---
  int potValue = readPotSmooth();

  if (modeColor) {
    // Map pot to hue range 0‚Äì230 (avoid red wraparound)
    hue = map(potValue, 0, 1023, 0, 230);
  } else {
    // Adjust brightness (8%‚Äì100% to keep LED visible)
    brightness = map(potValue, 0, 1023, 20, 255) / 255.0;
  }

  FastLED.setBrightness(brightness * 255);
  leds[0] = CHSV(hue, 255, 255);
  FastLED.show();

  // --- Serial output (only when values change) ---
  bool changed = false;
  if (modeColor && hue != lastHue) {
    lastHue = hue;
    changed = true;
  } else if (!modeColor && abs(brightness - lastBrightness) > 0.01) {
    lastBrightness = brightness;
    changed = true;
  }

  if (changed) {
    // Convert HSV to RGB for display
    CRGB rgbColor = CHSV(hue, 255, 255);

    Serial.print(F("HSV: ("));
    Serial.print(hue);
    Serial.print(F(", 255, "));
    Serial.print((uint8_t)(brightness * 255));
    Serial.print(F(")  |  RGB: ("));
    Serial.print(rgbColor.r);
    Serial.print(F(", "));
    Serial.print(rgbColor.g);
    Serial.print(F(", "));
    Serial.print(rgbColor.b);
    Serial.print(F(")  |  Brightness: "));
    Serial.print((int)(brightness * 100));
    Serial.println(F("%"));
  }

  delay(20);
}

